script: |
  super -f text -I q11844.spq | sort > q11844.out

inputs:
  - name: q11844.spq
    data: |
      SELECT ALL 10 AS col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE - col1 + col2 * + col1 NOT BETWEEN NULL AND ( - col0 );
  - name: tab2

outputs:
  - name: q11844.out
    data: |
      10
      10
      10
